project-purpose:
iSpotless:
When an employee find a problem, he can take photos/messages and submit them via iSpotless;
Then iSpotless will specify the problem and deliver it to those who are responsible for it;
If the problem is specified as valuable, this employee can get benefits(e.g. free coffee)

